class Bike_details {  String bikePhoto;  String numberPlate;  String year;  String model;  String color;  Bike_details({      this.bikePhoto,       this.numberPlate,       this.year,       this.model,       this.color});  Bike_details.fromJson(dynamic json) {    bikePhoto = json['bike_photo'];    numberPlate = json['number_plate'];    year = json['year'];    model = json['model'];    color = json['color'];  }  Map<String, dynamic> toJson() {    var map = <String, dynamic>{};    map['bike_photo'] = bikePhoto;    map['number_plate'] = numberPlate;    map['year'] = year;    map['model'] = model;    map['color'] = color;    return map;  }}